import React from 'react';
import hero from '../assets/home/photoguy.png';
import { Link } from 'react-router-dom'

const Home = () => {
  return (
    <section className='section'>
        <div className='container mx-auto h-full relative'>
          <div className='lg:w-1/2 lg:pr-12 flex flex-col justify-center'>
            <div className='w-full pt-36 pb-14 lg:pt-0 lg:pb-0 lg:w-auto z-10 lg:absolute flex flex-col justify-center items-center lg:items-start'>
              <h1 className='h1'>
                Nature<br />& <br />Landscape <br />Photographer
              </h1>
              <p className='text-[23px] lg:text-[36px] font-primary mb-4 lg:mb-12'>San Francisco, CA & Dallas, TX</p>
              <Link to={'/contact'} className='btn mb-[30px]'>Let's Connect</Link>
            </div>
            <div className='flex justify-end max-h-96 lg: max-h-max'>
              <div className='relative lg:w-1/2 mt-8 lg:mt-0'>
                <img src={hero} alt='photographer'/>
              </div>
            </div>
          </div>
        </div>
      </section>
  );
};

export default Home;
